var withoutConnection = false;

var player = {};
var farmers = [];
var tomatoPrice = 0;
var cornPrice = 0;
var wheatPrice = 0;

var ResponseHandlers = {

  login: function(msg) {
    if (msg.content.status === "success") {
      player = msg.content.player;
      tomatoPrice = msg.content.cropsPrice.tomato;
      cornPrice = msg.content.cropsPrice.corn;
      wheatPrice = msg.content.cropsPrice.wheat;
      this.getMap();
    }
  },

  create: function(msg) {
    switch (msg.content) {
      case 'created':
        alert("Account created !");
        break;
      case 'already':
        alert("Username already taken.");
        break;
    }
  },

  players: function(msg) {
    for (var i = 0; i < msg.content.length; i++) {
      if (msg.content[i].id != player.id) {
        if (!isPlayerExist(msg.content[i].id)) {
          addEnnemy(msg.content[i]);
        }
        else {
          updateEnnemy(msg.content[i]);
        }
      }
    }
  },

  players_update: function(msg) {
    for (var i = 0; i < msg.content.length; i++) {
      if (msg.content[i].id == player.id) {
        player = msg.content[i];
      }
    }
  },

  map: function(msg) {
    Network.serverMap = msg;

    startGame();
  },

  tile_owner: function(msg) {
    CameloteEngine.updateTileOwner(msg.content.position.x, msg.content.position.y, msg.content.ownedById, msg.content.ownedByName);
  },

  update_current_player: function(msg) {
    player = msg.content;
  },

  error: function(msg) {
    alert(msg.content);
  },

  chat: function(msg) {
    var cons = document.getElementById("display");
    cons.value = cons.value + msg.content + '\n';
  },

  update_tile_content: function(msg) {
    CameloteEngine.updateTileContent(msg.content);
  },

  update_tile_hum_fert: function(msg) {
    CameloteEngine.updateTileHumidityAndFertility(msg.content);
  },

  update_map: function(msg) {
    CameloteEngine.updateMap(msg.content);
  },

  update_crops_price: function(msg) {
    tomatoPrice = msg.content.tomato;
    cornPrice = msg.content.corn;
    wheatPrice = msg.content.wheat;
  },

  natural_event: function(msg) {
    CameloteEngine.doNaturalEvent(msg.content.type, msg.content.behavior, msg.content.area);
  }

};

if (!"WebSocket" in window)
{
  alert("WebSocket NOT supported by your Browser!");
}

